            AssertEx.EqualTolerance(2, (InverseAngle.FromInverseDegrees(3)-v).InverseDegrees, InverseDegreesTolerance);
            AssertEx.EqualTolerance(2, (v + v).InverseDegrees, InverseDegreesTolerance);
            AssertEx.EqualTolerance(10, (v*10).InverseDegrees, InverseDegreesTolerance);
            AssertEx.EqualTolerance(10, (10*v).InverseDegrees, InverseDegreesTolerance);
            AssertEx.EqualTolerance(2, (InverseAngle.FromInverseDegrees(10)/5).InverseDegrees, InverseDegreesTolerance);
            AssertEx.EqualTolerance(2, InverseAngle.FromInverseDegrees(10)/InverseAngle.FromInverseDegrees(5), InverseDegreesTolerance);
        }

        [Fact]
        public void ComparisonOperators()
        {
            InverseAngle oneInverseDegree = InverseAngle.FromInverseDegrees(1);
            InverseAngle twoInverseDegrees = InverseAngle.FromInverseDegrees(2);

            Assert.True(oneInverseDegree < twoInverseDegrees);
            Assert.True(oneInverseDegree <= twoInverseDegrees);
            Assert.True(twoInverseDegrees > oneInverseDegree);
            Assert.True(twoInverseDegrees >= oneInverseDegree);

            Assert.False(oneInverseDegree > twoInverseDegrees);
            Assert.False(oneInverseDegree >= twoInverseDegrees);
            Assert.False(twoInverseDegrees < oneInverseDegree);
            Assert.False(twoInverseDegrees <= oneInverseDegree);
        }

